import Login from './Login'
import Nav from './Nav'


const Main = (props) =>{
   
    if (props.isLogged){
        return(
            <div>
                <Nav/>
            </div>
        )
    }
        return(
            <div>
                <Login username={props.username} setUsername={props.setUsername} setIsLogged={props.setIsLogged}/>
            </div>
        )
    
}

export default Main;
